import React from "react";
import "./Navbar.css";
import logo from "../images/logo.png";

const Navbar = () => (
  <div className="navbar">
    <div className="logo">
      <img src={logo} alt="Logo" className="logo" />;<h1>FLAT FINDER</h1>
      <h1>Flat Finder</h1>
    </div>
    <ul>
      <li>Home</li>
      <li>Apartaments</li>
    </ul>
  </div>
);
export default Navbar;
